mapper.select:

select 

from DATAATTR
where DATAATTR_TYPE = #{dataattrType,jdbcType=DECIMAL}
  and DATAATTR_BITOFFSET = #{dataattrBitoffset,jdbcType=INTEGER}

mapper.delete:

delete from DATAATTR
where DATAATTR_TYPE = #{dataattrType,jdbcType=DECIMAL}
  and DATAATTR_BITOFFSET = #{dataattrBitoffset,jdbcType=INTEGER}
